export const searchBarVariant = {
  initial: { opacity: 0, y: "100%" },
  animate: {
    opacity: 1,
    y: 0,
    transition: {
      opacity: {
        delay: 0.2,
      },
      ease: "circOut",
      // type: "tween",
      duration: 0.3,
    },
  },
  exit: { opacity: 0, y: "20%" },
};
